import React from 'react';
import './index.css'


function Events(){

    const Back ={
        backgroundColor:'yellow'
    }
    const change =()=>{
        console.log('Hello');
    }

    return(
        <>
        <div className='eventBack' style={Back}>
            <button className='eventButton' onClick={change}>Click</button>
        </div>
        </>
    )
}

export default Events;
